//create book list component
//Path: src/views/BookList/BookList.js
import React, { Component } from 'react';
import { Link } from 'react-router-dom';
// import './BookList.css';

class BookList extends Component {
  render() {
    return (
      <div className="BookList">
        <h2>Book List</h2>
        <table>
          <thead>
            <tr>
              <th>Title</th>
              <th>Author</th>
              <th>ISBN</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>Book 1</td>
              <td>Author 1</td>
              <td>ISBN 1</td>
              <td>
                <Link to={`/edit/1`}>Edit</Link>
                <Link to={`/delete/1`}>Delete</Link>
              </td>
            </tr>
            <tr>
              <td>Book 2</td>
              <td>Author 2</td>
              <td>ISBN 2</td>
              <td>
                <Link to={`/edit/2`}>Edit</Link>
                <Link to={`/delete/2`}>Delete</Link>
              </td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

export default BookList;
